  UNKNOWN_ERROR(11),
  /** No assets were found in the VAST ad response. */
  VAST_ASSET_NOT_FOUND(12),
  /** A VAST response containing a single `<VAST>` tag with no child tags. */
  VAST_EMPTY_RESPONSE(13),
  /**
